  \"2016-11-25T21:06:41.342991\",\n\t\"name\": \"ed-grants-teaching-american-history\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Teaching American History supports professional
  development for U.S. history teachers.  This data-focused toolset site contains
  data visualizations and downloads related to the open grantmaking program. The program
  is designed to raise student achievement by improving teachers' knowledge and understanding
  of and appreciation for traditional U.S. history. Grant awards will assist LEAs,
  in partnership with entities that have content expertise, to develop, document,
  evaluate, and disseminate innovative and cohesive models of professional development.
  By helping teachers to develop a deeper understanding and appreciation of U.S. history
  as a separate subject matter within the core curriculum, these programs will improve
  instruction and raise student achievement. CFDA Number: 84.215X\",\n\t\"license_title\":
